const Image = (props) => {
    // テストコードです。
    console.log(props.toggle);
    // テスト検証
    const name = "foo"

    return(
        <>
            <div className="img">
                {(() => {
                    if (props.isSmile === true) {
                        return <span>5で割れる</span>
                    } else {
                        return <span>５で割れない</span>
                    }
                })()}
                <br/>
                {/* テスト検証 */}
                {(() => {
                    if (name === "goo") {
                        return <span>fooです</span>
                    } else {
                        return <span>fooでないです</span>
                    }
                })()}
            </div> 
        </>
    )
};
export default Image;
